from Seatmap import NightSeatmap


class Ui_Home(object):
    def openSeatmap(self):
        self.window = QtWidgets.QMainWindow()
        self.ui = NightSeatmap()
        self.ui.show()
    
    
    def check_total(self):
        total = self.spadult.value() + self.spchild.value() + self.spelderly.value() + self.spspecialguest.value()
        if total > 200:
            diff = total -200
            sender = self.sender()
            sender_value = sender.value()
            if sender_value > diff:
                sender.setvalue(sender_value-diff)
            else:
                sender.setValue(0)

    def Totalseats(self):
        self.adult = (self.spadult.value() * 10)
        self.child = (self.spchild.value() *5)
        self.elderly = (self.spelderly.value() *5)
        self.total = self.adult + self.child + self.elderly
        self.TotalPriceBooking.setText('£' + str(self.total))
        self.lnPaymentPrice.setText('£' + str(self.total))



